import styled from '@emotion/styled'

export const ListingWrapper = styled.div`
  width: min(90%, 1400px);
  display: flex;
  flex-direction: column;
  margin: auto;
`

export const ShopContainer = styled.div`
  display: flex;
  justify-content: center;
`
